import React from 'react';
import axios from 'axios'
import ItemListaDeUsuario from './ItemListaDeUsuario';
import { render } from '@testing-library/react';


// const baseUrl = "https://us-central1-future4-users.cloudfunctions.net/api"

// const request = axios.get(${baseURL}/endpont/idOuString,
//   headers:
//   )

const mockListaDeUsuarios = [{
  id:'1',
  name:"Henrique",
},
{
  id:'2',
  name:"Joao",
}
]


class ListaDeUsuario extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      listaDeUsuarios: [],
    }
  }


  render(){
    return(
      <ul>
        {mockListaDeUsuarios.map(usuario => (
          <ItemListaDeUsuario>{usuario.name} <span>X</span></ItemListaDeUsuario>
        ))}
      </ul>
    )
  }  
}

export default ListaDeUsuario;
